{"query":"{
     taskDetails(
     from: {{goBack7Days}}
     to:{{CurrentTime}} 

        filter: {
      and: [

            { origin: { equals: "{{NewPhoneContact.ANI}}" } }

        { isActive: { equals: false } } # Example of an additional filter in the AND clause
      ]
    }      
    ) 
            {   
                tasks {
                   id
                   isWithInServiceLevel     
                    }  
            }
}","variables":{}}

